/**
 * If checked the scraper will return results for mobile version of Google search. Otherwise desktop results are returned.
 */
export type MobileResults = boolean;
/**
 * If checked the lower quality results that Google normally filters out will be included.
 */
export type UnfilteredResults = boolean;
/**
 * If checked the HTML of the Google Search results pages will be stored to the default dataset, under the <code>html</code> property. This is useful if you need to process the HTML, but it makes the dataset large.
 */
export type SaveHTMLToDataset = boolean;
/**
 * If checked the HTML of the Google Search results pages will be stored to the default key-value store and links to the files stored to the dataset under the <code>htmlSnapshotUrl</code> property. This is useful for debugging since you can easily view the pages in the browser. However, the use of this feature may slow down the Actor.
 */
export type SaveHTMLToKeyValueStore = boolean;
/**
 * If checked all of the results (organicResults, paidResults, suggestedResults) will contain Base64-encoded icon image data if found.
 */
export type IncludeIconImageDataBase64 = boolean;

/**
 * Use this search the same way you would use Google, you can e.g. look for <code>cute cats</code>. Use a new line for each query.
 *  Click &#9655; <strong> Start </strong> to begin the scrape. If you need any guidance, just <a href='https://blog.apify.com/unofficial-google-search-api-from-apify-22a20537a951/#how-to-scrape-google-search-pages' target='_blank' rel='noopener'>follow this tutorial.</a>
 */
export interface GoogleSearchInput {
  queries: SearchTermS;
  resultsPerPage?: ResultsPerPage;
  maxPagesPerQuery?: MaxPagesPerSearch;
  countryCode?: Country;
  searchLanguage?: SearchLanguage;
  languageCode?: InterfaceLanguage;
  locationUule?: ExactLocationGoogleUULEParameter;
  forceExactMatch?: ForceExactMatch;
  site?: Site;
  relatedToSite?: RelatedToSite;
  wordsInTitle?: WordsInTitle;
  wordsInText?: WordsInText;
  wordsInUrl?: WordsInURL;
  quickDateRange?: QuickDateRange;
  beforeDate?: BeforeDate;
  afterDate?: AfterDate;
  fileTypes?: FileTypes;
  mobileResults?: MobileResults;
  includeUnfilteredResults?: UnfilteredResults;
  saveHtml?: SaveHTMLToDataset;
  saveHtmlToKeyValueStore?: SaveHTMLToKeyValueStore;
  includeIcons?: IncludeIconImageDataBase64;
  [k: string]: unknown;
}


import { Actor, type CallOptions } from 'apify';

/**
 * Calls the actor "googleSearch" with the provided input.
 * @param input - Must conform to the GoogleSearchInput type.
 * @param runOptions - Optional run options to pass to the actor.
 */
export async function callGoogleSearch(input: GoogleSearchInput, runOptions?: CallOptions): Promise<unknown> {
    return Actor.call('test', input, runOptions);
}
